.main-container-slant {
  position: relative;
  z-index: 3;
  background-color: #fff;
  &.no-slant::after {
    content: none;
  }

  &::before {
    position: absolute;
    content: '';
    z-index: -2;
    background-color: #0C3A60;
    width: 80%;
    height: 200px;
    transform: skewY(-3deg);
    right: 0;
    top: -20px;
  }

  & main {
    z-index: 4;
    position: relative;
  }

  &::after {
    background-color: inherit;
    position: absolute;
    content: '';
    width: 100%;
    height: 100%;
    top: -20px;
    transform: skewY(3deg);
    transform-origin: left bottom;
    z-index: -1;

