.contact-heading {
  width: 100%;
  margin-bottom: 50px;
  & h1 {
    font-size: 78px;
    text-align: center;
    margin: 150px auto; 
    margin-top: 0;
    line-height: 1;
    letter-spacing: 4px;
  }
}

#contact {  
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(280px, 1fr));
  justify-content: center;
  height: 600px;
  max-width: 1200px;
  margin: 0 auto;
  box-shadow: 0px 1px 21px 8px rgba(12,25,96,0.19);
  transform: translateY(-25%); 
  @include for-big-mobiles {
    grid-template-columns: 2fr 3fr;
  }

  & .box1 {
    background: #0C3A60;
    padding: 70px; 
    text-align: left;

    & h3 {
      font-size: 32px;
      color: #00a1d6;
      margin-bottom: 10px;
      font-style: italic;
    }
    & h2 {
      font-size: 50px;
      color: #fff;
      text-transform: uppercase;
      margin-bottom: 40px;
    }
    & h4 {
      font-size: 30px;
      color: #00a1d6;
      margin-top: 0;
    }
    & p {
      font-size: 18px;
      color: #fff;
      margin-bottom: 30px;
      line-height: 120%;
    }
    & .contact-care--apply-btn {
      color: #fff;
      border: 1px solid #00a1d6;
      padding: 10px 30px;
      text-decoration: none;
      text-transform: uppercase;
      font-weight: 600;
      transition: all .2s linear;
      &:hover {
        background: #00a1d6;
      }
    }

  }
  & .box2 {
    background: #fff;
    padding: 70px;

    & .apply-field, #comment {
      width: 230px;
      margin: 0 auto;
      display: flex;
      flex-direction: column;
    }

    & label {
      text-align: left;
      display: block;
      text-transform: uppercase;
      color: #0c3a60;
      font-size: 14px;
      font-weight: 700;
      margin-bottom: 4px;
    }

    & input, textarea, select {
      margin-bottom: 16px;
      padding: 10px 5px;
      background: #e2f3ff;
      border: 0;
    }
    & .form--required {
      color: red;
      font-size: 12px;
      font-weight: 700;
    }

    & #comment {
      margin-top: 16px;
      margin-bottom: 16px;
    }
    & #comment-submit__btn {
      text-transform: uppercase;
      font-weight: 600;
      border: 1px solid #0C3A60;
      padding: 10px 30px;
      cursor: pointer;
      transition: all .2s linear;
      &:hover {
        background: #0C3A60;
        color: #fff;
      }
    }

  }
}

